#include <stdio.h>
#include <stdbool.h>
#include <string.h>
#include <stdlib.h>

bool canConstruct(char* ransomNote, char* magazine) {

    if(strlen(ransomNote) > strlen(magazine)){
        return false;
    }else{
        //La bandera nos dice si se puede construir o no
        bool bandera = false;
        //Una segunda bandera que nos dice que ya no se encontro un match para uno, asi no evalua los demas
        bool encontrado = false;

        //Vamos a crear una lista del mismo tamanno de magazine que nos diga si ya se uso una posicion
        // Crear una nueva lista de booleanos con la misma longitud 
        int *lista_booleana = (int *)malloc(strlen(magazine) * sizeof(int)); 
        // Inicializar todos los elementos a 0 
        for (int i = 0; i < strlen(magazine); i++){
            lista_booleana[i] = 0;
        }

        for(int j = 0; j < strlen(ransomNote); j++){
            //cada vez que vamos a evaluar una letra de ransomNote tenemos que poner la bandera en falso
            bandera = false;
            //printf("Letra a evaluar de ransomNote: %c\n", ransomNote[j]);
            for(int k = 0; k < strlen(magazine); k++){
                //printf("Letra a evaluar de magazine: %c\n", magazine[k]);
                if(ransomNote[j] == magazine[k] && lista_booleana[k] == 0){
                    //Es verdad que lo encontro
                    encontrado = true;
                    bandera = true;
                    lista_booleana[k] = 1;

                    //Una vez encuentra una letra igual sale del for
                    k = strlen(magazine);
                }else{
                    //Si no lo encuentra
                    encontrado = false;
                }        
            }
            if(encontrado == false){
                //Si el for de arriba acaba y no encontro alguno, se acaba el for de fuera
                break;
            }
        }

        return bandera;

    }

}

void main(){
    char ransomNote[] = "";
    char magazine[] = "";

    printf("%d\n", canConstruct(ransomNote, magazine));
}